function Jack(){
    return(
        <div style={{backgroundColor:"aqua",padding:"20px"}}>
            <ul style={{listStyle:"none",display:"flex",justifyContent:"center"}}>
                <li>Home</li>
                <li>About</li>
                <li>Services</li>
            </ul>
        </div>
    )
}

export default Jack;
